import React from 'react'
import{Link} from "react-router-dom"
import Navbar from "../Navbar/Navbar"
import Footer from "../Footer/Footer"
import AboutMe from "../AboutMe/AboutMe"
import ContactMe from "../ContactMe/ContactMe"
import UsedTechnologies from "../UsedTechnologies/UsedTechnologies"

import { Paper, Grid, makeStyles, Typography, Box, Container } from '@material-ui/core';

import Hero from "../Hero/Hero"
import Banner from "../Banner/Banner"
const useStyles = makeStyles((theme) => ({
    root: {
        flexGrow: 1,
        backgroundColor: "#f3dfd4"
    },
}))
export default function Home() {
    const classes = useStyles();
    return (
        <div className={classes.root}>
            <Navbar />
            <Hero>
                <Banner title="" subtitle="Find Trusted And Skilled Employees"> <Link to="/employee" className="btn-primary">
                    <span className="blinking">Find Employee</span>
                </Link></Banner>
            </Hero>
            <AboutMe />
            <UsedTechnologies />

            <ContactMe />
            <Footer />
        </div>
    )
}
